import React, { Component } from "react"
import Table from './Table'

class App extends Component{

  state= {}

    render(){

    const characters = [
      {
        name: 'Charlie',
        job: 'Janitor',
      },
      {
        name: 'Mac',
        job: 'Bouncer',
      },
      {
        name: 'Dee',
        job: 'Aspring actress',
      },
      {
        name: 'Dennis',
        job: 'Bartender',
      },
    ]


      return(

      <div id="container">
        <Table characterData={characters}/>
      </div>
      )
    }
  }

export default App
